import{_ as e,o as i,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 50-73.133 Name of registered limited liability partnership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.133.md","filePath":"vacode/50-73.133.md"}'),a={name:"vacode/50-73.133.md"},o=r('<h1 id="§-50-73-133-name-of-registered-limited-liability-partnership" tabindex="-1">§ 50-73.133 Name of registered limited liability partnership. <a class="header-anchor" href="#§-50-73-133-name-of-registered-limited-liability-partnership" aria-label="Permalink to &quot;§ 50-73.133 Name of registered limited liability partnership.&quot;">​</a></h1><p>A. The name of a partnership that is also a registered limited liability partnership shall contain the words &quot;Registered Limited Liability Partnership&quot; or &quot;Limited Liability Partnership&quot; or the abbreviation &quot;R.L.L.P.&quot; or &quot;L.L.P.&quot; or the designation &quot;RLLP&quot; or &quot;LLP.&quot;</p><p>B. The name of a limited partnership that is also a registered limited liability partnership shall comply with the requirements of subdivision A 2 of § <a href="http://law.lis.virginia.gov/vacode/50-73.78/" target="_blank" rel="noreferrer">50-73.78</a>.</p><p>1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0292" target="_blank" rel="noreferrer">292</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0163" target="_blank" rel="noreferrer">163</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0631" target="_blank" rel="noreferrer">631</a>.</p>',4),l=[o];function n(s,p,d,h,c,_){return i(),t("div",null,l)}const g=e(a,[["render",n]]);export{m as __pageData,g as default};
